import React from 'react';
import { BrowserRouter as Router, Route, Redirect } from 'react-router-dom';
import DefaultPage from './page/default';
import ThanksPage from './page/thanks';

function App() {
  return (
    <Router>
      <Route path="/" exact>
        <DefaultPage />
      </Route>
      <Route path="/thanks" exact>
        <DefaultPage />
      </Route>
      <Redirect />
    </Router>
  );
}

export default App;
